import { Animal } from "../models/Animal";


export function Animals () {
    let animals: Animal[] = [];

    let animalsString: string = localStorage.getItem("animals") || "[]";
    animals = JSON.parse(animalsString);

    console.log(animals);

    return <div>Got {animals.length} animals</div>;
};
